func (o *HistoryTraplocation) Preload(name string, retrieved any) error {
	if o == nil {
		return nil
	}

	switch name {
	case "Organization":
		rel, ok := retrieved.(*Organization)
		if !ok {
			return fmt.Errorf("historyTraplocation cannot load %T as %q", retrieved, name)
		}

		o.R.Organization = rel

		if rel != nil {
			rel.R.HistoryTraplocations = HistoryTraplocationSlice{o}
		}
		return nil
	default:
		return fmt.Errorf("historyTraplocation has no relationship %q", name)
	}
}

type historyTraplocationPreloader struct {
	Organization func(...psql.PreloadOption) psql.Preloader
}

func buildHistoryTraplocationPreloader() historyTraplocationPreloader {
	return historyTraplocationPreloader{
		Organization: func(opts ...psql.PreloadOption) psql.Preloader {
			return psql.Preload[*Organization, OrganizationSlice](psql.PreloadRel{
				Name: "Organization",
				Sides: []psql.PreloadSide{
					{
						From:        HistoryTraplocations,
						To:          Organizations,
						FromColumns: []string{"organization_id"},
						ToColumns:   []string{"id"},
					},
				},
			}, Organizations.Columns.Names(), opts...)
		},
	}
}

