// LoadOrganization loads the historyTraplocation's Organization into the .R struct
func (o *HistoryTraplocation) LoadOrganization(ctx context.Context, exec bob.Executor, mods ...bob.Mod[*dialect.SelectQuery]) error {
	if o == nil {
		return nil
	}

	// Reset the relationship
	o.R.Organization = nil

	related, err := o.Organization(mods...).One(ctx, exec)
	if err != nil {
		return err
	}

	related.R.HistoryTraplocations = HistoryTraplocationSlice{o}

	o.R.Organization = related
	return nil
}

// LoadOrganization loads the historyTraplocation's Organization into the .R struct
func (os HistoryTraplocationSlice) LoadOrganization(ctx context.Context, exec bob.Executor, mods ...bob.Mod[*dialect.SelectQuery]) error {
	if len(os) == 0 {
		return nil
	}

	organizations, err := os.Organization(mods...).All(ctx, exec)
	if err != nil {
		return err
	}

	for _, o := range os {
		if o == nil {
			continue
		}

		for _, rel := range organizations {
			if !o.OrganizationID.IsValue() {
				continue
			}

			if !(o.OrganizationID.IsValue() && o.OrganizationID.MustGet() == rel.ID) {
				continue
			}

			rel.R.HistoryTraplocations = append(rel.R.HistoryTraplocations, o)

			o.R.Organization = rel
			break
		}
	}

	return nil
}

type historyTraplocationJoins[Q dialect.Joinable] struct {
	typ          string
	Organization modAs[Q, organizationColumns]
}

func (j historyTraplocationJoins[Q]) aliasedAs(alias string) historyTraplocationJoins[Q] {
	return buildHistoryTraplocationJoins[Q](buildHistoryTraplocationColumns(alias), j.typ)
}

func buildHistoryTraplocationJoins[Q dialect.Joinable](cols historyTraplocationColumns, typ string) historyTraplocationJoins[Q] {
	return historyTraplocationJoins[Q]{
		typ: typ,
		Organization: modAs[Q, organizationColumns]{
			c: Organizations.Columns,
			f: func(to organizationColumns) bob.Mod[Q] {
				mods := make(mods.QueryMods[Q], 0, 1)

				{
					mods = append(mods, dialect.Join[Q](typ, Organizations.Name().As(to.Alias())).On(
						to.ID.EQ(cols.OrganizationID),
					))
				}

				return mods
			},
		},
	}
}
